import { Link } from "react-router-dom";

export default function Mechanics({image, name, shopName, location, rating}){

  return(
    <div class="card" style="width: 18rem;">
      <img src={image} alt={name}/>
      <div class="card-body">
        <h4 class="card-title">{shopName}</h4>
        <h5 class="card-text">{location}</h5>
        <h5 class="card-text">{name}</h5>
        <div>
          <li>Ave Price: {price}</li> <li>Rating: {rating}</li>
        </div>
        <Link class="btn btn-primary">More Details</Link>
      </div>
    </div>
  )
}
